import window98 from "../img/window98.png";

const Footer = () => {
    return(
        <footer className="footer">
            <div className="window">
                <span className="start-button-highlight"></span>
                <img src={window98} alt="window98 img" className="window98" />
                <span className="start">시작</span>
            </div>
        </footer>
    );
}
export default Footer;
